{"cells":[{"source":"<a href=\"https://www.kaggle.com/msspeas/bellabeat-case-study?scriptVersionId=89205669\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"313eb123","metadata":{"_cell_guid":"42fbefe0-c4b0-4308-9204-e281f48945bb","_uuid":"a91aa223-fb88-4d90-afa4-104af7fde425","papermill":{"duration":0.050202,"end_time":"2022-03-03T15:01:17.79043","exception":false,"start_time":"2022-03-03T15:01:17.740228","status":"completed"},"tags":[]},"source":["\n","# How Can a Wellness Technology Company Play It Smart?\n","\n","## Introduction\n","\n","Bellabeat is a high-tech wellness company that manufactures health-focused smart products for women. The company was founded in 2013 by Urška Sršen and Sando Mur. The products developed by the company are connected to the Bellabeat app and collect data on activity, sleep, stress, and reproductive health to inform women about their health and habits. the products currenlty on the market are the Leaf, Time, and Spring. Urška Sršen, cofounder and Chief Creative Officer, has asked for analysis on a Fitbit dataset to inform recommendations on marketing strategy.\n","\n","### Questions for Analysis\n","\n","* What are some trends in smart device usage?\n","* How could these trends apply to Bellabeat customers?\n","* How could these trends help influence Bellabeat marketing strategy?\n","\n","#### Prepare\n","\n","This analysis uses FitBit Fitness Tracker Data (https://www.kaggle.com/arashnic/fitbit). The dataset contain data from thirty Fitbit users. These users have consented to the submission of personal tracker data. I chose RStudio Cloud for analysis. \n","\n","#### 1. Load Library"]},{"cell_type":"code","execution_count":1,"id":"ca357a29","metadata":{"_cell_guid":"38311352-028d-4928-b692-9cda93382fcb","_uuid":"7cd7e2ec-12dd-499c-a687-f