ADwEgh2AAAAAF4C\nwQ4AAADASyDYAQAAAHgJBDsAAAAAL4FgBwAAAOAlEOwAAAAAvASCHQAAAICX+H+Ykwl0X7MY\nvAAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["ggplot(data=sleep) + \n","  geom_point(mapping=aes(x=TotalMinutesAsleep, y=TotalTimeInBed)) +\n","  geom_smooth(mapping=aes(x=TotalMinutesAsleep, y=TotalTimeInBed, method=\"loess\")) +\n","  labs(title=\"Sleepy Time\", x=\"Total Minutes Asleep\", y=\"Total Time In Bed\")"]},{"cell_type":"markdown","id":"39037faa","metadata":{"_cell_guid":"f437417c-8884-4014-9a19-2f7897e96596","_uuid":"09df640b-858a-4c46-bfc8-7cd230bf512d","papermill":{"duration":0.138843,"end_time":"2022-03-03T15:01:26.897699","exception":false,"start_time":"2022-03-03T15:01:26.758856","status":"completed"},"tags":[]},"source":["## Summary\n","\n","These datasets are a start in determining how people use fitness trackers. There are limits in not knowing the demographics of the users in order to perform analysis with those factors included. We are able to see that the weekends log the most steps and Monday's the least. This would be an opportunity to use the app to alert users to move more throughout the week or set weekly goals that have daily targets to reach. The correlation that a user with more sedentary minutes has less distance with the tracker is an opportunity to nudge users to move more as well. Encouraging users to walk or move could be a way to determine how stress factors into sedentary minutes as well. When looking at sleep, overall total time in bed does relate to minutes spent asleep. \n","\n","Bellabeat also has the opportunity to take these metrics and provide users with data that shows past months activity, sleep, and stress in relation to the menstrual cycle. The user is able to see trends and replicate or adjust according to previous metrics in order to impact their current cycle. Overall, more data is needed with specific data from women in order to see what metrics are related and what metrics are most important to women users."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":12.830163,"end_time":"2022-03-03T15:01:27.145881","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-03-03T15:01:14.315718","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}